    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from September through
    December of 1956. The report begins by summarizing the weather conditions and water
    conditions during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include grazing and timber removal. The
    public relations section of the report describes recreational uses, Refuge visitors,
    hunting, and fishing. Items of interest and N-R forms are attached.",nt"owner_org":
